    console.log("data ", data);
    let changed = [];
    data.map((history) => (
      changed.push(parseJSON(history.changes))
    ))

    setHistory(changed);
  };

  useEffect(() => {
    fetchContactHistory();
  }, [])

  console.log("Show component receivedData:", location.state);

